// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";

import "../interfaces/IUserProfileManager.sol";
import "../structs/FoodTypes.sol"; 

contract UserProfileManager is Initializable, OwnableUpgradeable, IUserProfileManager {
    mapping(address => UserProfile) private _userProfiles;
    address public foodAppContractAddress; 

    error UserProfileManager__InvalidAddress();
    error UserProfileManager__UnauthorizedCaller();
    error UserProfileManager__ProfileNotFound();
    error UserProfileManager__EmptyName();
    error UserProfileManager__AlreadyInitialized(); 
    error UserProfileManager__NotInitializing();   

    // === Modifiers ===
    modifier onlyFoodApp() {
        if (msg.sender != foodAppContractAddress) {
            revert UserProfileManager__UnauthorizedCaller();
        }
        _;
    }

    modifier onlyFoodAppOrOwner() {
        if (msg.sender != foodAppContractAddress && msg.sender != owner()) {
            revert UserProfileManager__UnauthorizedCaller();
        }
        _;
    }

    function initialize(address _foodAppContract, address _initialOwner) public override initializer 
    {
        if (_foodAppContract == address(0) || _initialOwner == address(0)) {
            revert UserProfileManager__InvalidAddress();
        }
        __Ownable_init(_initialOwner);
        foodAppContractAddress = _foodAppContract;
    }

    // === IUserProfileManager Implementation ===

    function createOrUpdateUserProfile(
        address user,
        string calldata name,
        string calldata phoneNumber,
        string calldata email,
        string calldata imageUrl
    ) external override onlyFoodApp { 
        if (user == address(0)) revert UserProfileManager__InvalidAddress();
        if (bytes(name).length == 0) revert UserProfileManager__EmptyName();

        UserProfile storage profile = _userProfiles[user];
        bool isNewProfile = (profile.userAddress == address(0));

        profile.userAddress = user;
        profile.name = name;
        profile.phoneNumber = phoneNumber;
        profile.email = email;
        profile.imageUrl = imageUrl;

        if (isNewProfile) {
            profile.isActive = true; 
            profile.registrationDate = uint128(block.timestamp);
            emit UserProfileCreated(user, name, profile.registrationDate);
        } else {
            emit UserProfileUpdated(user, name);
        }
    }

    function getUserProfile(address user) external view override returns (UserProfile memory profile) {
        if (_userProfiles[user].userAddress == address(0)) {
            revert UserProfileManager__ProfileNotFound();
        }
        return _userProfiles[user];
    }

    function userProfileExists(address user) external view override returns (bool) {
        return _userProfiles[user].userAddress != address(0);
    }

    function activateUserProfile(address user) external override onlyFoodAppOrOwner {
        if (_userProfiles[user].userAddress == address(0)) {
            revert UserProfileManager__ProfileNotFound();
        }
        UserProfile storage profile = _userProfiles[user];
        if (!profile.isActive) {
            profile.isActive = true;
            emit UserProfileActivityChanged(user, true);
        }
    }

    function deactivateUserProfile(address user) external override onlyFoodAppOrOwner {
        if (_userProfiles[user].userAddress == address(0)) {
            revert UserProfileManager__ProfileNotFound();
        }
        UserProfile storage profile = _userProfiles[user];
        if (profile.isActive) {
            profile.isActive = false;
            emit UserProfileActivityChanged(user, false);
        }
    }

    // function updateSpecificProfileFields(...) external override onlyFoodApp { ... } // Implement if needed

    // --- Versioning for upgradeability (optional but good practice) ---
    // function version() external pure returns (string memory) {
    //     return "1.0.0";
    // }
}

structs/FoodTypes.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

enum Role { None, Admin, Customer, FOH, BOH } // FOH: Front of House, BOH: Back of House

enum OrderStatus { Placed, Confirmed, Preparing, Ready, Delivered, Completed, Cancelled }

struct MenuItem {
    uint128 id;
    uint128 restaurantId;
    string name;
    string menuTitle;
    uint128 price;
    bool available;
    string description;
    string category;
    uint128 totalRating; 
    uint128 ratingCount; 
    uint128 preparationTime;
}

struct UpdateMenuItemParams {
    uint128 restaurantId;
    uint128 menuId;
    string name;
    string menuTitle;
    uint128 price;
    bool available;
    string description;
    string category;
    uint128 preparationTime;
    uint128 totalRating; 
    uint128 ratingCount;
}

struct OrderItemDetail {
    uint128 menuItemId;
    string name;
    uint128 pricePerUnit;
    uint128 quantity;
}

struct Order {
    uint128 id;
    address customer;
    uint128 restaurantId;
    OrderItemDetail[] itemsDetail;
    uint256 totalPrice;
    OrderStatus status;
    uint128 timestamp;
    uint128 preparationTime; 
    uint128 quantity;
}

struct Restaurant {
    uint128 id;
    address owner; 
    string name;
    // Thêm các trường khác
}

struct Review {
    uint128 id;
    address customer;
    address staff;
    uint128 restaurantId;
    uint8 rating;
    string comment;
    uint128 timestamp;
}

struct StaffReview {
    uint128 id;
    address customer;
    address staff;
    uint128 restaurantId;
    uint8 rating;
    string comment;
    uint128 timestamp;
}

struct MenuItemReview {
    uint128 id;
    address customer;
    uint128 menuItemId;
    uint128 restaurantId;
    uint8 rating;
    string comment;
    uint128 timestamp;
}

struct UserProfile {
    address userAddress; 
    string name;
    string phoneNumber;
    string email; 
    string imageUrl;
    bool isActive; 
    uint128 registrationDate;
}
struct RestaurantStaffMember {
    address staffAddress; 
    Role staffRole;       
    uint128 restaurantId; 
    uint128 assignmentDate;
}

interfaces/IUserProfileManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

import "../structs/FoodTypes.sol"; // Để dùng UserProfile struct

interface IUserProfileManager {
    event UserProfileCreated(address indexed user, string name, uint128 registrationDate);
    event UserProfileUpdated(address indexed user, string name);
    event UserProfileActivityChanged(address indexed user, bool isActive);
    
    function initialize(address _foodAppContract, address _initialOwner) external;
    function createOrUpdateUserProfile(
        address user,
        string calldata name,
        string calldata phoneNumber,
        string calldata email,
        string calldata imageUrl
    ) external;

    function getUserProfile(address user) external view returns (UserProfile memory profile);

    function userProfileExists(address user) external view returns (bool);

    function activateUserProfile(address user) external;

    function deactivateUserProfile(address user) external;

    // Có thể có các hàm admin khác nếu cần, ví dụ:
    // function adminUpdateUserProfile(address userAddr, bytes32 displayName, ...) external onlyOwner;
}

